import { categoriesDetails } from "../../constants";

const Categories = () => {
  return (
    <section className="max-container max-sm:mt-12">
      <div className="flex flex-col justify-start gap-5">
        <h2 className="text-2xl font-palanquin font-semibold">Categories</h2>
              <div className="mt-16 grid lg:grid-cols-6 md:grid-cols-4 sm:grid-cols-3 grid-cols-1 sm:gap-6 gap-14">
                  {
                      categoriesDetails.map(category => (
                        <div>
                              <img src={ category.icon} width={20} className=""></img>
                              <h5>{ category.title}</h5>
                          </div>    
                      ))

                  }
        </div>
      </div>
    </section>
  );
}

export default Categories
